import React from 'react';
import '/.App.css';

const RoundImgBtnWDescription = ({ image, description, url }) => {
  const handleClick = () => {
    // Redirect to the provided URL
    window.open(url, '_blank');
  };

  return (
    <div className="text-center">
      <button onClick={handleClick} className="RoundBtnHeader">
        <img src={image} alt="Button Image" className="w-8 h-8 object-cover" />
      </button>
      <p className="mt-2">{description}</p>
    </div>
  );
};

export default RoundImgBtnWDescription;
